import React from "react";
import DeleteIcon from "@material-ui/icons/Delete";

const Note = (props) => {
    function handleClick() {
        props.onDelete(props.id);
    }

    return (
        <div class="note card bg-white border-light m-2">
            <div class="card-header fs-5 fw-bold">{props.title}</div>
            <div class="card-body">
                <p class="card-text fs-6">{props.content}</p>
            </div>
            <div class="card-footer">
                <button onClick={handleClick}>DELETE</button>
            </div>
        </div>    
    );
}

export default Note;
